import React, { useState, useEffect } from 'react';
import { Card, Form, Button, Alert, Spinner } from 'react-bootstrap';
import apiService from '../services/api.service';

const SwaggerConverter = () => {
  const [swaggerFiles, setSwaggerFiles] = useState([]);
  const [selectedFile, setSelectedFile] = useState('');
  const [authorizationTypes, setAuthorizationTypes] = useState([]);
  const [injections, setInjections] = useState({
    xss: false,
    sql: false,
    html: false,
  });
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState({ type: '', text: '' });

  useEffect(() => {
    loadSwaggerFiles();
  }, []);

  const loadSwaggerFiles = async () => {
    try {
      const response = await apiService.get('/api/swagger/files');
      setSwaggerFiles(response.files || []);
    } catch (error) {
      setMessage({ type: 'danger', text: error.message || 'Failed to load Swagger files' });
    }
  };

  const handleConvert = async () => {
    if (!selectedFile) {
      setMessage({ type: 'warning', text: 'Please select a Swagger file' });
      return;
    }

    setLoading(true);
    setMessage({ type: '', text: '' });

    try {
      const response = await apiService.post('/api/conversions/convert', {
        swagger_file_id: selectedFile,
        include_xss: injections.xss,
        include_sql: injections.sql,
        include_html: injections.html,
        authorization_types: authorizationTypes,
      });

      setMessage({ type: 'success', text: 'Conversion started successfully!' });
    } catch (error) {
      setMessage({ type: 'danger', text: error.message || 'Conversion failed' });
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h2 className="mb-4">Swagger Converter</h2>
      
      {message.text && (
        <Alert variant={message.type} dismissible onClose={() => setMessage({ type: '', text: '' })}>
          {message.text}
        </Alert>
      )}

      <Card>
        <Card.Header>
          <h5 className="mb-0">Convert Swagger to Postman</h5>
        </Card.Header>
        <Card.Body>
          <Form>
            <Form.Group className="mb-3">
              <Form.Label>Select Swagger File</Form.Label>
              <Form.Select
                value={selectedFile}
                onChange={(e) => setSelectedFile(e.target.value)}
              >
                <option value="">-- Select a Swagger file --</option>
                {swaggerFiles.map((file) => (
                  <option key={file.id} value={file.id}>
                    {file.name}
                  </option>
                ))}
              </Form.Select>
            </Form.Group>

            <Form.Group className="mb-3">
              <Form.Label>Authorization Types</Form.Label>
              <div>
                <Form.Check
                  type="checkbox"
                  label="API Key"
                  checked={authorizationTypes.includes('apiKey')}
                  onChange={(e) => {
                    if (e.target.checked) {
                      setAuthorizationTypes([...authorizationTypes, 'apiKey']);
                    } else {
                      setAuthorizationTypes(authorizationTypes.filter(t => t !== 'apiKey'));
                    }
                  }}
                />
                <Form.Check
                  type="checkbox"
                  label="Bearer Token"
                  checked={authorizationTypes.includes('bearer')}
                  onChange={(e) => {
                    if (e.target.checked) {
                      setAuthorizationTypes([...authorizationTypes, 'bearer']);
                    } else {
                      setAuthorizationTypes(authorizationTypes.filter(t => t !== 'bearer'));
                    }
                  }}
                />
                <Form.Check
                  type="checkbox"
                  label="Basic Auth"
                  checked={authorizationTypes.includes('basic')}
                  onChange={(e) => {
                    if (e.target.checked) {
                      setAuthorizationTypes([...authorizationTypes, 'basic']);
                    } else {
                      setAuthorizationTypes(authorizationTypes.filter(t => t !== 'basic'));
                    }
                  }}
                />
              </div>
            </Form.Group>

            <Form.Group className="mb-3">
              <Form.Label>Security Injections</Form.Label>
              <div>
                <Form.Check
                  type="checkbox"
                  label="XSS Injections"
                  checked={injections.xss}
                  onChange={(e) => setInjections({ ...injections, xss: e.target.checked })}
                />
                <Form.Check
                  type="checkbox"
                  label="SQL Injections"
                  checked={injections.sql}
                  onChange={(e) => setInjections({ ...injections, sql: e.target.checked })}
                />
                <Form.Check
                  type="checkbox"
                  label="HTML Injections"
                  checked={injections.html}
                  onChange={(e) => setInjections({ ...injections, html: e.target.checked })}
                />
              </div>
            </Form.Group>

            <Button
              variant="primary"
              onClick={handleConvert}
              disabled={loading || !selectedFile}
            >
              {loading ? (
                <>
                  <Spinner animation="border" size="sm" className="me-2" />
                  Converting...
                </>
              ) : (
                'Convert'
              )}
            </Button>
          </Form>
        </Card.Body>
      </Card>
    </div>
  );
};

export default SwaggerConverter;
